import {useEffect,useState} from 'react'
import './search.css'
import Api from '../../axios/Axios'

const Seach = () => {

  const [inputValue,setInputValue]= useState(undefined)

  function searchArticles(){
    if(inputValue!== undefined){
      window.location.href = `/blog/search/${inputValue}`

    }
  }


  return (
    <div className='seach-box'>
      <form>
        <input onChange={(e)=>{setInputValue(e.target.value)}} className='search-input' type="text"  placeholder='pesquisar artigo...'/>
      </form>
      <button onClick={()=>{searchArticles()}} className="search-btn">
        <img src="./../../../img/icons/iconsearch.svg" />
      </button>
    </div>
  )
}

export default Seach
